SELECT  col_id, colab.departamento_dep_id, colab.col_nome, car.car_descricao, dep_descricao
FROM colaborador colab 
INNER JOIN cargo car INNER JOIN departamento dep 
ON colab.departamento_dep_id = dep.dep_id 
AND colab.cargo_car_id = car.car_id
ORDER BY col_id;

